package challenge;

public class TwoOne {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 5, b = 4;
		System.out.println("++a-b--:" + (++a - b--));
		a = 5;
		b = 4;
		System.out.println("a%b++ :" + (a % b++));
		a = 5;
		b = 4;
		System.out.println("a*=b+5 :" + (a *= b + 5));
		a = 5;
		b = 4;
		System.out.println("69>>2 :" + (69 >> 2));

	}
}
